export default function QuestionHead(props:any){
    return(
            <div className='options'>
                <h3 className='text-2xl font-semibold'>Options</h3>
                <div onClick={props.add}>
                    <i className="fa-solid fa-square-plus" id="add-option-btn"></i>
                </div>
            </div>
    )
}
